import React, { useState, useRef, useEffect } from "react";

function Field({
  points,
  setPoints,
  offsets,
  rotation,
  fieldImagePixels,
  scale,
  handleClick,
  handleMouseDown,
  handleDoubleClick,
  handleMouseMove,
  handleMouseUp,
}) {
  const [hoveredIndex, setHoveredIndex] = useState(null);
  const [contextMenu, setContextMenu] = useState({
    visible: false,
    x: 0,
    y: 0,
    index: null,
  });
  const containerRef = useRef(null);
  const menuRef = useRef(null);

  // Reset hoveredIndex if it becomes invalid (like after deleting a point)
  useEffect(() => {
    if (hoveredIndex !== null && hoveredIndex >= points.length) {
      setHoveredIndex(null);
    }
  }, [points, hoveredIndex]);

  useEffect(() => {
    const handleClickOutside = (e) => {
      if (
        contextMenu.visible &&
        menuRef.current &&
        !menuRef.current.contains(e.target)
      ) {
        setContextMenu({ visible: false, x: 0, y: 0, index: null });
      }
    };

    document.addEventListener("mousedown", handleClickOutside);
    return () => {
      document.removeEventListener("mousedown", handleClickOutside);
    };
  }, [contextMenu.visible]);

  return (
    <div
      ref={containerRef}
      style={{
        position: "relative",
        display: "inline-block",
        width: fieldImagePixels,
        height: fieldImagePixels,
        userSelect: "none",
      }}
      onClick={handleClick}
      onMouseMove={handleMouseMove}
      onMouseUp={handleMouseUp}
      className="image"
    >
      <img
        src="/jerryfield.png"
        alt="VEX Field"
        style={{
          width: `${fieldImagePixels}px`,
          height: `${fieldImagePixels}px`,
          transform: `rotate(${rotation}deg)`,
          transition: "transform 0.3s ease",
          userSelect: "none",
          pointerEvents: "none",
        }}
        draggable={false}
      />

      {/* Lines connecting points */}
      <svg
        style={{
          position: "absolute",
          top: 0,
          left: 0,
          width: `${fieldImagePixels}px`,
          height: `${fieldImagePixels}px`,
          pointerEvents: "none",
          zIndex: 0,
        }}
      >
        {points.length > 1 &&
          points.map((point, index) => {
            if (index === 0) return null;
            const prev = points[index - 1];
            return (
              <line
                key={index}
                x1={prev.rawX}
                y1={prev.rawY}
                x2={point.rawX}
                y2={point.rawY}
                stroke="black"
                strokeWidth="2"
              />
            );
          })}

        {/* Heading lines on hover */}
        {hoveredIndex !== null &&
          (() => {
            const point = points[hoveredIndex];
            if (!point) return null; // Safety check to avoid crash

            const heading = point.heading ?? 0;
            const length = 300; // pixels
            const angleRad = ((heading + 90) * Math.PI) / 180;
            const x2 = point.rawX + length * Math.cos(angleRad);
            const y2 = point.rawY - length * Math.sin(angleRad);

            return (
              <line
                key={`hover-heading`}
                x1={point.rawX}
                y1={point.rawY}
                x2={x2}
                y2={y2}
                stroke="rgba(255, 0, 0, 0.6)"
                strokeWidth="2"
              />
            );
          })()}
      </svg>

      {/* Points and robot rectangles */}
      {points.map((point, index) => {
        const widthInches = offsets.left + offsets.right;
        const heightInches = offsets.front + offsets.back;
        const widthPixels = widthInches / scale;
        const heightPixels = heightInches / scale;

        const top =
          point.rawY -
          heightPixels / 2 +
          (offsets.front - offsets.back) / 2 / scale;
        const left =
          point.rawX -
          widthPixels / 2 +
          (offsets.right - offsets.left) / 2 / scale;

        // Scroll wheel to rotate heading arrow on point
        const handleWheel = (e) => {
          e.preventDefault();
          e.stopPropagation();

          const delta = e.deltaY < 0 ? 1 : -1;
          const newHeading = ((point.heading ?? 0) + delta + 360) % 360;

          const updatedPoints = [...points];
          updatedPoints[index] = {
            ...point,
            heading: newHeading,
          };
          setPoints(updatedPoints);
        };

        return (
          <React.Fragment key={index}>
            {/* Rotated robot box with heading arrow */}
            <div
              style={{
                position: "absolute",
                top,
                left,
                width: widthPixels,
                height: heightPixels,
                pointerEvents: "none",
                transform: `rotate(${-point.heading ?? 0}deg)`,
                transformOrigin: "center center",
              }}
            >
              <div
                style={{
                  width: "100%",
                  height: "100%",
                  border: "2px solid blue",
                  backgroundColor: "rgba(255, 255, 255, 0.3)",
                  boxSizing: "border-box",
                }}
              />
              <div
                style={{
                  position: "absolute",
                  top: 2,
                  left: "50%",
                  transform: "translateX(-50%)",
                  width: 0,
                  height: 0,
                  borderLeft: "6px solid transparent",
                  borderRight: "6px solid transparent",
                  borderBottom: "10px solid red",
                }}
              />
            </div>

            {/* Draggable red dot */}
            <div
              onMouseDown={() => {
                handleMouseDown(index);
              }}
              onDoubleClick={(e) => {
                e.stopPropagation(); // Prevent double click from triggering parent click
                handleDoubleClick(index);
              }}
              onContextMenu={(e) => {
                e.preventDefault();
                setContextMenu({
                  visible: true,
                  x: e.clientX,
                  y: e.clientY,
                  index,
                });
              }}
              onWheel={handleWheel}
              onMouseEnter={() => {
                setHoveredIndex(index);
                document.body.style.overflow = "hidden";
              }}
              onMouseLeave={() => {
                setHoveredIndex(null);
                document.body.style.overflow = "";
              }}
              style={{
                position: "absolute",
                top: point.rawY - 5,
                left: point.rawX - 5,
                width: "10px",
                height: "10px",
                borderRadius: "50%",
                background: "red",
                cursor: "grab",
                zIndex: 2,
              }}
            />

            {/* Coordinate label */}
            <div
              style={{
                position: "absolute",
                top: point.rawY - 20,
                left: point.rawX + 10,
                fontSize: "12px",
                color: "black",
                background: "white",
                padding: "2px 4px",
                borderRadius: "4px",
                pointerEvents: "none",
                zIndex: 1,
              }}
            >
              ({Math.round(point.x)}, {Math.round(point.y)}) @{" "}
              {Math.round(point.heading ?? 0)}Â°
            </div>
            {contextMenu.visible && (
              <div
                ref={menuRef}
                style={{
                  position: "fixed",
                  top: contextMenu.y,

                  //mess with formatting for readability

                  left: contextMenu.x,
                  backgroundColor: "rgba(255, 255, 255, 0.4)",
                  //border: "1px solid gray",
                  boxShadow: "3px 3px 3px 6px rgba(0,0,0,0.2)",
                  zIndex: 100,
                  padding: "4px",
                  fontSize: "12px",
                }}
                onMouseLeave={() =>
                  setContextMenu({ visible: false, x: 0, y: 0, index: null })
                }
                onClick={(e) => e.stopPropagation()}
              >
                <div
                  style={{
                    display: "flex",
                    flexDirection: "column",
                    alignItems: "left",
                    padding: "4px",
                    color: "black",
                  }}
                >
                  <div
                    style={{
                      display: "flex",
                      alignItems: "left",
                      padding: "4px",
                    }}
                  >
                    <label style={{ marginRight: "6px" }}>
                      intake for (ms):
                    </label>
                    <input
                      type="number"
                      value={points[contextMenu.index]?.intakeTime ?? ""}
                      onChange={(e) => {
                        const val = e.target.value;
                        const newValue = val === "" ? "" : parseFloat(val);
                        const updated = [...points];
                        updated[contextMenu.index] = {
                          ...updated[contextMenu.index],
                          intakeTime: newValue,
                        };
                        setPoints(updated);
                      }}
                      style={{ width: "60px" }}
                    />
                  </div>

                  <div
                    style={{
                      display: "flex",
                      alignItems: "left",
                      padding: "4px",
                    }}
                  >
                    <label style={{ marginRight: "6px" }}>
                      outtake for (ms):
                    </label>
                    <input
                      type="number"
                      value={points[contextMenu.index]?.outtakeTime ?? ""}
                      onChange={(e) => {
                        const val = e.target.value;
                        const newValue = val === "" ? "" : parseFloat(val);
                        const updated = [...points];
                        updated[contextMenu.index] = {
                          ...updated[contextMenu.index],
                          outtakeTime: newValue,
                        };
                        setPoints(updated);
                      }}
                      style={{ width: "60px" }}
                    />
                  </div>

                  <div
                    style={{
                      display: "flex",
                      alignItems: "left",
                      padding: "4px",
                    }}
                  >
                    <label style={{ marginRight: "6px" }}>descore:</label>
                    <input
                      type="checkbox"
                      checked={!!points[contextMenu.index]?.descore}
                      onChange={(e) => {
                        const updated = [...points];
                        updated[contextMenu.index] = {
                          ...updated[contextMenu.index],
                          descore: e.target.checked,
                        };
                        setPoints(updated);
                      }}
                    />
                  </div>

                  <div
                    style={{
                      display: "flex",
                      alignItems: "left",
                      padding: "4px",
                    }}
                  >
                    <label style={{ marginRight: "6px" }}>pneum:</label>
                    <select
                      value={points[contextMenu.index]?.pneumatics ?? ""}
                      onChange={(e) => {
                        const value = e.target.value;
                        const updated = [...points];
                        updated[contextMenu.index] = {
                          ...updated[contextMenu.index],
                          pneumatics: value === "" ? null : value,
                        };
                        setPoints(updated);
                      }}
                    >
                      <option value="high">high</option>
                      <option value="low">low</option>
                    </select>
                  </div>

                  <div
                    style={{
                      display: "flex",
                      alignItems: "left",
                      padding: "4px",
                    }}
                  >
                    <label style={{ marginRight: "6px" }}>hoard motors:</label>
                    <select
                      value={points[contextMenu.index]?.hoardMotors ?? ""}
                      onChange={(e) => {
                        const value = e.target.value;
                        const updated = [...points];
                        updated[contextMenu.index] = {
                          ...updated[contextMenu.index],
                          hoardMotors: value === "" ? null : value,
                        };
                        setPoints(updated);
                      }}
                    >
                      <option value="true">true</option>
                      <option value="false">false</option>
                    </select>
                  </div>

                  <div
                    style={{
                      display: "flex",
                      alignItems: "left",
                      padding: "4px",
                    }}
                  >
                    <label style={{ marginRight: "6px" }}>ram descore:</label>
                    <select
                      value={points[contextMenu.index]?.ramDescore ?? ""}
                      onChange={(e) => {
                        const value = e.target.value;
                        const updated = [...points];
                        updated[contextMenu.index] = {
                          ...updated[contextMenu.index],
                          ramDescore: value === "" ? null : value,
                        };
                        setPoints(updated);
                      }}
                    >
                      <option value="true">true</option>
                      <option value="false">false</option>
                    </select>
                  </div>

                  <div
                    style={{
                      display: "flex",
                      alignItems: "left",
                      padding: "4px",
                    }}
                  >
                    <label style={{ marginRight: "6px" }}>slew:</label>
                    <input
                      type="number"
                      value={points[contextMenu.index]?.slew ?? ""}
                      onChange={(e) => {
                        const val = e.target.value;
                        const newValue = val === "" ? "" : parseFloat(val);
                        const updated = [...points];
                        updated[contextMenu.index] = {
                          ...updated[contextMenu.index],
                          slew: newValue,
                        };
                        setPoints(updated);
                      }}
                      style={{ width: "60px" }}
                    />
                  </div>
                </div>
              </div>
            )}
          </React.Fragment>
        );
      })}
    </div>
  );
}

export default Field;
